pragma solidity ^0.8.17;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router02.sol";
import "@uniswap/v2-core/contracts/interfaces/IUniswapV2Factory.sol";

interface IMyLPToken {
    function transfer(address recipient, uint256 amount) external returns (bool);
    function balanceOf(address account) external view returns (uint256);
}

contract Miragrow is IERC20, Ownable {
    string private constant _name         = "Miragrow";
    string private constant _symbol       = "MIRA";
    uint8 private constant _decimals      = 9;
    uint256 private constant _totalSupply = 1_000_000_000 * (10**_decimals);

    mapping (address => uint256) private _balances;
    mapping (address => mapping (address => uint256)) private _allowances;

    //0xF24294C0CF99c88452495D3e73c47a578402e317
    address payable private constant _walletMarketing = payable(0x05825fFC6eA5fE6857f4AE3a7Ffc8ed045F402ec);

    mapping (address => bool) private _noFees;

    address private constant _swapRouterAddress = address(0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D);
    IUniswapV2Router02 private _primarySwapRouter = IUniswapV2Router02(_swapRouterAddress);
    mapping (address => bool) private _isLP;

    uint256 public startTime;       // Reward Start Time
    uint256 public weekTime;        // Reward Weekly Time

    address public latest_1 = address(0);
    address public latest_2 = address(0);
    address public latest_3 = address(0);

    address[] public buyers;        //For weekly reward
    mapping (address => uint256) lastBuyTime;
    
    uint256 public randomResult;    //For Random Generator
    uint256 private nonce = 0;

    constructor() {
        _balances[owner()] = _totalSupply * 99 / 100;
        _balances[_walletMarketing] = _totalSupply * 1 / 100;

        _noFees[owner()] = true;
        _noFees[address(this)] = true;
        _noFees[_swapRouterAddress] = true;
        _noFees[_walletMarketing] = true;

        startTime = block.timestamp;
        weekTime = block.timestamp;
    }

    receive() external payable {}
    
    function totalSupply() external pure override returns (uint256) { return _totalSupply; }
    function decimals() external pure returns (uint8) { return _decimals; }
    function symbol() external pure returns (string memory) { return _symbol; }
    function name() external pure returns (string memory) { return _name; }
    function balanceOf(address account) public view override returns (uint256) { return _balances[account]; }
    function allowance(address holder, address spender) external view override returns (uint256) { return _allowances[holder][spender]; }

    function approve(address spender, uint256 amount) public override returns (bool) {
        _allowances[msg.sender][spender] = amount;
        return true;
    }

    function transfer(address recipient, uint256 amount) external override returns (bool) {
        return _transferFrom(msg.sender, recipient, amount);
    }

    function transferFrom(address sender, address recipient, uint256 amount) external override returns (bool) {
        if(_allowances[sender][recipient] != type(uint256).max){
            _allowances[sender][recipient] = _allowances[sender][recipient] - amount;
        }
        return _transferFrom(sender, recipient, amount);
    }

    function _approveRouter(uint256 _tokenAmount) internal {
        if ( _allowances[owner()][_swapRouterAddress] < _tokenAmount ) {
            _allowances[owner()][_swapRouterAddress] = type(uint256).max;
        //    emit Approval(address(this), _swapRouterAddress, type(uint256).max);
        }
    }

    function _transferFrom(address sender, address recipient, uint256 amount) public returns (bool) {
        require(sender != address(0), "No transfers from Zero wallet");

        // // if buy more than 0.05 eth && isLp, register to latest buyer
        // address[] memory path = new address[](2);
        // path[0] = address(this);
        // path[1] = address(0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2);

        // uint[] memory amounts = _primarySwapRouter.getAmountsOut (amount, path);

        // if(_isLP[sender]) {     // Buyer
        //     require(block.timestamp - lastBuyTime[recipient] > 60, "Can buy after 60 seconds");

        //     lastBuyTime[recipient] = 0;

        //     if(amounts[0] > 0.5 * (10 ** 18))
        //         lastBuyTime[recipient] = block.timestamp;
                
        //     if(amounts[0] > 0.05 * (10 ** 18)){
        //         latest_3 = latest_2;
        //         latest_2 = latest_1;
        //         latest_1 = recipient;

        //         if(indexOf(recipient) == type(uint256).max)
        //             buyers.push(recipient);
        //     }
        // }

        // transfer token without taxAmount
        uint256 _taxAmount = _calculateTax(sender, recipient, amount);
        uint256 _transferAmount = amount - _taxAmount;
        
        _balances[sender] -= amount;
        _balances[recipient] += _transferAmount;

        uint256 _lastPotEth = address(this).balance;

        if ( _taxAmount > 0 ) {
            _balances[address(this)] += _taxAmount;
            
            // swap tax tokens in token contract to eth
            // _swapTaxTokensForEth(_balances[address(this)]);
            // _balances[address(this)] = 0;

            // send 1/5 to marketing wallet
            // uint256 _taxEth = address(this).balance - _lastPotEth;
            // _walletMarketing.transfer(_taxEth * 1 / 5);

            // rewardLatestPlayers();
        }

//        emit Transfer(sender, recipient, amount);
        return true;
    }

    function rewardLatestPlayers() public payable{
        uint256 potBalance = address(this).balance;

        // Every week
        if(block.timestamp > 604800 + weekTime) {
            payable(buyers[getRandomNumber()]).transfer(potBalance * 50 / 100);

            weekTime = block.timestamp;
        }

        // Every 12 hours
        else if (block.timestamp > 42300 + startTime) {
            payable(latest_1).transfer(potBalance * 5 / 100);
            payable(latest_2).transfer(potBalance * 3 / 100);
            payable(latest_3).transfer(potBalance * 2 / 100);

            startTime = block.timestamp;
        }

        weekTime += ((block.timestamp - weekTime) / 604800) * 604800;
        startTime += ((block.timestamp - startTime) / 42300) * 42300;
    }

    function _calculateTax(address sender, address recipient, uint256 amount) internal view returns (uint256) {
        uint256 taxAmount;
        
        if ( !_noFees[sender] && !_noFees[recipient] ) { 
            if ( _isLP[sender] || _isLP[recipient] ) {
                taxAmount = amount * 5 / 100;
            }
        }

        return taxAmount;
    }

    function _swapTaxTokensForEth(uint256 tokenAmount) private {
        _approveRouter(tokenAmount);
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = _primarySwapRouter.WETH();
        _primarySwapRouter.swapExactTokensForETHSupportingFeeOnTransferTokens(tokenAmount,0,path,address(this),block.timestamp);
    }

    function _transferProfit(uint256 tokenAmount) external payable onlyOwner {
        payable(owner()).transfer(tokenAmount);
    }
 
    function indexOf(address target) private view returns (uint) {
        for (uint i = 0; i < buyers.length; i++) {
            if (buyers[i] == target) {
                return i;
            }
        }

        return type(uint256).max;
    }

    function getRandomNumber() private returns (uint256) {
        uint256 randomNumber = uint256(keccak256(abi.encodePacked(block.timestamp, msg.sender, nonce))) % 100;
        nonce++;
        randomResult = randomNumber;
        return randomNumber;
    }
}
